import React, { useState } from 'react'

export const Home = () => {
    const [todos, serTodos] = useState([
       {
               id:1,
               title:"lorem 1",
               done: false
             },
             {
               id:2,
               title:"lorem 2",
               done: true
             },
    ])
  return (
      <div>
          halo :
          {todos.title}
      </div>
  )
}
